useEffect(()=>{
    axios.get(`https://fakestoreapi.com/carts/5`)
    .then((response)=>{
        console.log(response.data);
        setProduct(response.data);
    });
},[])

return(
    <>

    {
      product && product.length>0 && product.map((products)=>{
        console.log(products);

        return(
          <>
            <p>{products}</p>
          </>
        )
      })
    }

  </>

)

}

